// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// 定义一个接口
interface IBank {
    function deposit() external payable;  // 接口中的存款函数
}

// 父合约 Bank 实现了 IBank 接口
contract Bank is IBank {
    mapping(address => uint256) public deposits;  // 存款记录
    address public owner;

    constructor() {
        owner = msg.sender;  // 设置管理员
    }

    // 定义存款方法，添加 virtual 修饰符
    function deposit() public payable override virtual {
        require(msg.value > 0, "Deposit amount must be greater than 0");
        deposits[msg.sender] += msg.value;  // 记录存款
    }

    // 提款功能，仅管理员可调用
    function withdraw(uint256 amount) external {
        require(msg.sender == owner, "Only the owner can withdraw");
        require(address(this).balance >= amount, "Insufficient balance");
        payable(owner).transfer(amount);  // 提款给管理员
    }
}

// 子合约 BigBank 继承自 Bank
contract BigBank is Bank {
    // 自定义修饰符，确保存款金额大于 0.001 ether
    modifier minDeposit() {
        require(msg.value > 0.001 ether, "Minimum deposit is 0.001 ether");
        _;
    }

    // 重写存款方法
    function deposit() public payable override minDeposit {
        super.deposit();  // 调用父合约的存款方法
    }
}

